import React from "react";
import Nav from "react-bootstrap/Nav";
import NavDropdown from "react-bootstrap/NavDropdown";

function Header() {
  return (
    <div className="max-w-5xl mx-auto py-2 font-medium flex justify-between">
      <div>
        <ul className="flex">
          <li>로고</li>
          <li>종만서비스</li>
          <li>종만시스템</li>
          <li>종만피플</li>
          <li>블로그</li>
        </ul>
      </div>
      <div>
        <ul className="flex">
          <li>로그인</li>
          <li>회원가입</li>
          <li>상담신청하기</li>
        </ul>
      </div>
    </div>
  );
}

export default Header;
